(1, '<h4 style=\"text-align:center\"><span style=\"font-size:20px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong><span style=\"background-color:#D3D3D3\">مرحبا بك في موقع انجاز للكتب التعليمية</span></strong></span></span></h4>\r\n\r\n<h4 style=\"text-align:center\"><span style=\"font-size:16px\"><strong>هذا هو موقع فريق إنجاز للكتب التعليمية التي تصدر عن دار النشر ( إنجاز للمطبوعات ) والتي تهتم بالمقام الأول بالكتب التعليمية للأطفال في مختلف المجالات والتخصصات والتي جذبت الكثير من الناس إليها لجمال تصميماتها وسهولة الأفكار وأرتباطها بالمتعة والتسلية فعندما يذيع صوت الفائدة والمتعة تجد اسم الفريق يرفرف عالياً ...</strong></span></h4>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:16px\"><strong>يمكنكم طلب ومشاهدة الكتب الخاصة بالفريق من خلال رابط الموقع التالي :&nbsp; &nbsp;<a href=\"http://www.enjaz-shop.com\"><span style=\"color:#000000\">www.enjaz-shop.com</span></a></strong></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"color:#2F4F4F\"><span style=\"font-size:22px\"><strong><span style=\"background-color:#FAEBD7\">إنجاز رائدة في الكتب التعليمية&nbsp;</span></strong></span></span></p>', '<h4 style=\"text-align:center\"><span style=\"font-size:22px\"><span style=\"color:#800080\"><strong>اللهم رب السماوات السبع ورب العرش العظيم</strong></span></span></h4>\r\n\r\n<h4 style=\"text-align:center\"><span style=\"font-size:22px\"><span style=\"color:#800080\"><strong>ربنا ورب كل شيء، فالق الحب والنوى ومنزل التوراة والإنجيل والفرقان</strong></span></span></h4>\r\n\r\n<h4 style=\"text-align:center\"><span style=\"font-size:22px\"><span style=\"color:#800080\"><strong>أعوذ بك من شر كل شيء أنت آخذ بناصيته، أنت الأول فليس قبلك شيء، وأنت الآخر فليس بعدك شيء، وأنت الظاهر فليس فوقك شيء</strong></span></span></h4>\r\n\r\n<h4 style=\"text-align:center\"><span style=\"font-size:22px\"><span style=\"color:#800080\"><strong>وأنت الباطن فليس دونك شيء، اقضِ عنا الدين، وأغننا من الفقر.</strong></span></span><br />\r\n<br />\r\n&nbsp;</h4>', '<h4><span style=\"color:#FF0000\"><span style=\"font-size:24px\">الموقع خاص لدار نشر ( إنجاز للمطبوعات ) متخصصة بإصدار الكتب التعليمية</span></span></h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:22px\">نسعى جاهدين تقديم أفضل الكتب التعليمية بأفكار ممتعة ومميزة بنمط حديث وتصاميم جذابة يمكنكم الدخول الى موقعنا الإلكتروني : <a href=\"http://www.enjaz-shop.com\"><span style=\"color:#0000FF\">www.enjaz-shop.com</span>&nbsp;</a></span></p>\r\n\r\n<p><span style=\"font-size:22px\">والاطلاع على الكتب الصادرة عنا وكذلك القيام بعملية الشراء والدفع&nbsp;</span></p>\r\n\r\n<p><span style=\"color:#008000\"><span style=\"font-size:22px\">سائلين المولى عزوجل التوفيق دوماً وأبداً</span></span></p>', 'enjaaz85@hotmail.com', 'https://www.facebook.com', 'https://www.engaz.com', '97809022  00968', 'https://www.twitter.com', 'https://www.instagram.com/enjaaz85/', NULL, 'الرستاق', NULL, '2020-12-01 12:25:32');
